#
# View "viewKK"
#

CREATE
  ALGORITHM = UNDEFINED
  VIEW `viewKK`
  AS
SELECT
  `jemaat_kk`.`kk_id`,
  `kk`.`id`,
  `kk`.`kk`,
  `kk`.`kode_kk`,
  `kk`.`users_id`,
  `kk`.`telepon`,
  `kk`.`hp`,
  `kk`.`alamat`,
  `kk`.`provinsi`,
  `kk`.`kabupaten`,
  `kk`.`kecamatan`,
  `kk`.`kelurahan`,
  `kk`.`kode_pos`,
  `kk`.`lingkungan`,
  `kk`.`created_at`,
  `kk`.`updated_at`,
  `kk`.`deleted_at`,
  `ksp`.`ksp`,
  `ksp`.`wijk_id`,
  `wijk`.`wijk`,
  `anggota_jemaat`.`nama`,
  `anggota_jemaat`.`nik`,
  `jemaat_kk`.`status`,
  `jemaat_kk`.`ksp_id`
FROM
  (((((`jemaat_kk`
    LEFT JOIN `kk` ON (`jemaat_kk`.`kk_id` = `kk`.`id`))
    LEFT JOIN `anggota_kk` ON (`kk`.`id` = `anggota_kk`.`kk_id`))
    LEFT JOIN `anggota_jemaat` ON (`anggota_kk`.`anggota_jemaat_id` = `anggota_jemaat`.`id`))
    LEFT JOIN `ksp` ON (`jemaat_kk`.`ksp_id` = `ksp`.`id`))
    LEFT JOIN `wijk` ON (`ksp`.`wijk_id` = `wijk`.`id`))
WHERE
  (`anggota_jemaat`.`hubungan_keluarga` = 'KEPALA KELUARGA' OR `anggota_jemaat`.`hubungan_keluarga` = 'SUAMI') AND `jemaat_kk`.`jemaat_id` = '1';
